import { Button, Table,Select, Space  } from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';
import { AiOutlineCheck, AiOutlineClose } from "react-icons/ai";
import "./style/style.css"



const Tables = () => {
  const [setSelectedRowKeys] = useState([]);
  const [setLoading] = useState(false);
  const [data, setdata] = useState([])
  const [data1, setdata1] = useState([])
  const [data2, setdata2] = useState([])
  const [data3, setdata3] = useState([])
  const [data4, setdata4] = useState([])
  const [data5, setdata5] = useState([])
  const [data6, setdata6] = useState([])
  const [page, setPage] = useState(1)



  const columns = [
    {
      title: 'Id',
      dataIndex: 'id',
    },
    {
      title: 'Name',
      dataIndex: 'name',
    },
    {
      title: 'Price',
      dataIndex: 'price',
    },
    {
      title: 'Status',
      dataIndex: 'is_active',
      render: (el) => <div  >{el ? (<h1 style={{ color: "green" }}><AiOutlineCheck /></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineClose className='AiOutlineClose' /></h1>)}</div>


    },
    {
      title: "Ma'lumot",
      key: "edit",
      width: "5%",
      render: (__, item) => {
        return <div><Button onClick={() => { getOneProduct(item) }} style={{ background: 'orange', color: 'white' }} type="text">Ma'lumot</Button></div>
      }
    },
    {
      title: "Edit",
      key: "edit",
      width: "5%",
      render: () => {
        return <div><Button onClick={()=>postoyna1()} style={{ background: 'orange', color: 'white' }} type="danger">O'zgartirish</Button></div>
      }
    },
    {
      title: "Delete",
      key: "delete",
      width: "5%",
      render: (key) => {
        return <div>
          <Button onClick={() => daleteAxiox(key.id)} type="danger">O'chirish</Button>
        </div>

      }
    },
  ];
  const getOneProduct = (item) => {
    setdata(item)
    setPage(2)
    console.log(item);

  }

  function getData() {
    axios.get(`${url}/api/cars/`).then(res => {
      setdata1(res.data)
    })
  }
  useEffect(() => {
    getData()
  }, [])


  function getFuel() {
    axios.get(`${url}/api/fuel_sort/`).then(res => {
      setdata2(res.data)
    })
  }
  useEffect(() => {
    getFuel()
  }, [])

  function getGear() {
    axios.get(`${url}/api/gear_box/`).then(res => {
      setdata3(res.data)
    })
  }
  useEffect(() => {
    getGear()
  }, [])

  function getGar() {
    axios.get(`${url}/api/garant/`).then(res => {
      setdata4(res.data)
    })
  }
  useEffect(() => {
    getGar()
  }, [])

  function getPosit() {
    axios.get(`${url}/api/position/`).then(res => {
      setdata6(res.data)
    })
  }
  useEffect(() => {
    getPosit()
  }, [])

  function getBranch() {
    axios.get(`${url}/api/branch/`).then(res => {
      setdata5(res.data)
    })
  }
  useEffect(() => {
    getBranch()
  }, [])



  function daleteAxiox(id) {
    console.log(id,"slaom");
    axios.delete(`${url}/api/cars/${id}/`, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res => {
      alert("ishladi")
      window.location.reload()
    }).catch(err => {
      alert("ishlamadi")
    })
  }

  function postoyna() {
    document.querySelector(".postoyna").style = "position:fixed;right:0px;  transition: 1s;"
    document.querySelector("body").style = "background: rgba(0, 0, 0, 0.5);"
  }
  function postoynaa() {
    document.querySelector(".postoyna").style = "position:fixed;right:-100%;  transition: 1s;"
  }
  function postoyna1() {
    document.querySelector(".postoyna1").style = "position:fixed;right:0;  transition: 1s;"
  }
  function postoynaa1() {
    document.querySelector(".postoyna1").style = "position:fixed;right:-100%;  transition: 1s;"
  }

  function getPost() {
    var formdata = new FormData()
    formdata.append("position",document.querySelector("#poz").value)
    formdata.append("fuel_sort",document.querySelector("#yoq").value)
    formdata.append("gearbox",document.querySelector("#vit").value)
    formdata.append("garant",document.querySelector("#gar").value)
    formdata.append("branch",document.querySelector("#fil").value)
    formdata.append("year",document.querySelector(".yil").value)
    formdata.append("distance",document.querySelector(".mas").value)
    formdata.append("engine",document.querySelector(".dvi").value)
    formdata.append("colour",document.querySelector(".rang").value)
    formdata.append("views",document.querySelector(".kor").value)
    formdata.append("description",document.querySelector(".tavsifi").value)
    formdata.append("time_create",document.querySelector(".vaqt").value)
    formdata.append("time_update",document.querySelector(".vaqt1").value)
    // formdata.append("is_active",document.querySelector(".faol").value)
    formdata.append("name",document.querySelector(".ism").value)
    formdata.append("initial_price",document.querySelector(".bosh").value)
    formdata.append("price",document.querySelector(".narx").value)
    formdata.append("sale",document.querySelector(".sot").value)
    formdata.append("depozit",document.querySelector(".dep").value)
    formdata.append("fuel_consumption",document.querySelector(".yoq1").value)
    var faol=formdata.append("is_active",document.querySelector(".faol").value)
    if(faol==true){
    formdata.append("is_active",document.querySelector(".faol").value)
    }
    else{
    (el) => <div  >{el ? (<h1 style={{ color: "green" }}><AiOutlineClose/></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineCheck /></h1>)}</div>
    }


    axios.post(`${url}/api/cars/`, formdata, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res => {
      alert("ishladimoqda")
      window.location.reload()
    }).catch(err => {
      alert("ishlamadi")
      console.log(err);
    })
  }

  function getPut(id) {
    var formdata = new FormData()
    formdata.append("position",document.querySelector("#poz").value)
    formdata.append("fuel_sort",document.querySelector("#yoq").value)
    formdata.append("gearbox",document.querySelector("#vit").value)
    formdata.append("garant",document.querySelector("#gar").value)
    formdata.append("branch",document.querySelector("#fil").value)
    formdata.append("year",document.querySelector(".yil").value)
    formdata.append("distance",document.querySelector(".mas").value)
    formdata.append("engine",document.querySelector(".dvi").value)
    formdata.append("colour",document.querySelector(".rang").value)
    formdata.append("views",document.querySelector(".kor").value)
    formdata.append("description",document.querySelector(".tavsifi").value)
    formdata.append("time_create",document.querySelector(".vaqt").value)
    formdata.append("time_update",document.querySelector(".vaqt1").value)
    formdata.append("name",document.querySelector(".ism").value)
    formdata.append("initial_price",document.querySelector(".bosh").value)
    formdata.append("price",document.querySelector(".narx").value)
    formdata.append("sale",document.querySelector(".sot").value)
    formdata.append("depozit",document.querySelector(".dep").value)
    formdata.append("fuel_consumption",document.querySelector(".yoq1").value)
    var faol=formdata.append("is_active",document.querySelector(".faol").value)
    if(faol==true){
    formdata.append("is_active",document.querySelector(".faol").value)
    }
    else{
      console.log("faol");
    }

    axios.put(`${url}/api/cars/${id}/`, formdata, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res => {
      alert("ishladimoqda")
      window.location.reload()
    }).catch(err => {
      alert("ishlamadi")
      console.log(err);
    })
  }

  const start = () => {
    setLoading(true);
    // ajax request after empty completing
    setTimeout(() => {
      setSelectedRowKeys([]);
      setLoading(false);
    }, 100);
  };






  return (
    <div>
      {page == 1 ? (<div><Button onClick={() => postoyna()} className='qoshish' type="primary">Qo'shish</Button><Table className='table' columns={columns} dataSource={data1} /></div>) : (
        <div>
          <div className="nomi1">
            <h1 className='nomi'>{data.name}</h1>
            <Button onClick={() => (setPage(1))} type="danger">Orqaga</Button>
          </div>
          <div className="alltext">
            <div className="alltext2">
              <div className="alltext1">
                <div className="text1">
                  <div className="text">
                    <h1>Pozitsiya</h1>
                    <input type="text" value={data.position.name} id='inp1' />
                  </div>
                  <div className="text">
                    <h1>Seriya</h1>
                    <input type="text" value={data.position.series.name} />
                  </div>
                  <div className="text">
                    <h1>Model</h1>
                    <input type="text" value={data.position.series.model.name} />
                  </div>
                  <div className="text">
                    <h1>Yoqilg'i turi</h1>
                    <input type="text" value={data.fuel_sort.name} />
                  </div>
                  <div className="text">
                    <h1>Vites qutisi</h1>
                    <input type="text" value={data.gearbox.name} />
                  </div>
                  <div className="text">
                    <h1>Garant</h1>
                    <input type="text" value={data.garant.name} />
                    <h1>Garant Soat</h1>
                    <input type="text" value={data.garant.time} />
                  </div>
                </div>
                <div className="text2">
                  <div className="text">
                    <h1>Filial</h1>
                    <input type="text" value={data.branch.name} />
                  </div>
                  <div className="text">
                    <h1>Yili</h1>
                    <input type="text" value={data.year} />
                  </div>
                  <div className="text">
                    <h1>Masofa</h1>
                    <input type="text" value={data.distance} />
                  </div>
                  <div className="text">
                    <h1>Dvigatel</h1>
                    <input type="text" value={data.engine} />
                  </div>
                  <div className="text">
                    <h1>Rang</h1>
                    <input type="text" value={data.colour} />
                  </div>
                  <div className="text">
                    <h1>Ko'rishlar</h1>
